const API_URL = 'http://127.0.0.1:8000';
var player = document.getElementById("player");
var chart = document.getElementById("points");
var title = document.getElementById("title");
var statistics = document.getElementById("statistics");
var participantName = "";
var races = 0;
var labels = new Array();
var graph;

function requestPastData(){
    getData("/api/pastriverraces")
        .then(response => {
            data = response;
            scores();
        }).catch(error => {
            console.log("Error while fetching")
        })
}

async function getData(url = '') {
    url = API_URL + url;

    const response = await fetch(url, {
        method: 'GET'
    });
    return await response.json();
}

function scores(){
    buildSelect();
}

function buildSelect(){
    var participants = getParticipants();
    participants.forEach(participant => {
        var sOption = document.createElement("option");
        sOption.value = participant.tag;
        sOption.innerHTML = participant.name;
        player.appendChild(sOption);
    })
}

function getParticipants(){
    var clans = data.pastWars[0].items[0].standings;
    var actualParticipants = new Array();
    data.pastWars.forEach(war => {
        war.items[0].standings.forEach(standing => {
            if(standing.clan.name == "Helvaetia power"){
                standing.clan.participants.forEach(participant => {
                    if(!containsParticipant(actualParticipants, participant)){
                        actualParticipants.push(participant);
                    }
                })
            }
        });
    })
    return actualParticipants.sort(orderParticipantsByName);
}

function orderParticipantsByName(participant, participant2){
    if ( participant.name < participant2.name ){
        return -1;
    }
    if ( participant.name > participant2.name ){
        return 1;
    }
    return 0;
}

function containsParticipant(actualParticipants, participant){
    for(var i=0;i<actualParticipants.length;i++){
        if(actualParticipants[i].name ==  participant.name){
            return true;
        }
    }
    return false;
}

player.onchange = function(){
    var points = getPlayerData(player.value)
    getPlayerName(player.value);
    drawGraph(points);
    printData(points);

}

function drawGraph(points){
    if(graph != null){
        graph.destroy();
    }
    var graphData = {
        labels: labels,
        datasets: [{
            label: 'Points won',
            backgroundColor: '#62CCFA',
            borderColor: '#5791DE',
            data: points,
        }]
    };
    config = {
        type: 'bar',
        data: graphData,
        options: {
            responsive: true,
            maintainAspectRatio: false,
            scales: {
                y: {
                    suggestedMax: 3600,
                    suggestedMin: 0,
                    ticks: {
                        stepSize: 200
                    }        
                }
            }
        }
    };
    graph = new Chart(
        chart,
        config
    );
}

function getPlayerData(tag){
    races = 0;
    labels = new Array();
    var playerPoints = new Array();
    data.pastWars.forEach(war => {
        war.items.forEach(race => {
            race.standings.forEach(standing => {
                if(standing.clan.name == "Helvaetia power"){
                    var participant = standing.clan.participants.find(participant => participant.tag == tag);
                    if(participant != null){
                        playerPoints.push(participant.fame);
                        labels.push("Season " + race.seasonId);
                        races++;
                    }
                    
                }else{
                    return;
                }
            })
        })
    })
    return playerPoints;
}

function getPlayerName(tag){
    var name = "";
    data.pastWars.forEach(war => {
        war.items.forEach(race => {
            race.standings.forEach(standing => {
                if(standing.clan.name == "Helvaetia power"){
                    var participant = standing.clan.participants.find(participant => participant.tag == tag);
                    if(participant != null){
                        name = participant.name
                    }
                }else{
                    return;
                }
            })
        })
    })
    participantName = name;
    title.innerHTML = "Statistics for " + name
}

function printData(points){
    var container = document.getElementById("statisticsBox");
    var minititle = document.getElementById("miniTitle");
    var total = document.getElementById("total");
    var average = document.getElementById("average");
    minititle.innerHTML = "found " + participantName + " in " + races + " races";
    total.innerHTML = sum(points);
    average.innerHTML = avg(points);
    container.style.display = "block";
}

function sum(points){
    var sum = 0;
    points.forEach(point => {
        sum += point;
    })
    return sum;
}

function avg(points){
    var sum = 0;
    var counter = 0;
    points.forEach(point => {
        sum += point;
        counter++;
    })
    return sum/counter;
}

function createRow(key, value){
    var tr = document.createElement("tr");
    var td1 = document.createElement("td");
    var td2 = document.createElement("td");
    td1.innerHTML = key;
    td2.innerHTML = value;
    tr.appendChild(td1);
    tr.appendChild(td2);
    return tr;
}

window.addEventListener('afterprint', () => {
    graph.resize();
  });


